import gql from 'graphql-tag'

const ALL_CHARACTERS = gql`
  query {
    character(page: 1) {
      id
      name
      image
      status
      species
      location {
        name
      }
      origin {
        name
      }
    }
  }
`

export default ALL_CHARACTERS
